};

function OrderDetailPrint(props) {
  return (
    <div className="OrderDetailPrint">
      <h3>Thông tin đơn hàng</h3>
      <span>Ngày(date)____tháng(month)_____năm(year)______ </span>
      <div className="Header">
        <div className="LogoCompany"></div>
        <div className="InfoCompany">
          <span className="Label"></span><span className="Content"></span>
        </div>
      </div>
      <div className="InfoBuyer">

      </div>
      <div className="Order">

      </div>
      <div className="Footer"></div>
    </div>
  );
}

export default OrderDetailPrint;
